Mumbai Mast Kallander' is a gripping saga of two
brothers - Ram and Shyam - small town boys, who 
land in Mumbai to fulfill their dreams of becomi
celebrity dons. It also features the life and   
ove of two live-in friends Rhea and Meghna. Rhea
whose life and dream is her salon while Meghna, 
who dreams of nothing but the Oscar awards.     
Mr. Raheja, a builder, is a spoiled brat whose  
father is Bade Bhayia... Don Shensha is the     
complicated killer who loves Amitabh Bachchan   
but  hates laughter.. When their path meets     
and they come across each  other you get...     
